import React from 'react'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function TitleHeader() {
  return (
    <section>
        <Container>
      <Row>
        <Col>1 of 1</Col>
      </Row>
    </Container>
    </section>
  )
}

export default TitleHeader
